import React from 'react'

 const marvelPageItemComponent =(props) =>{
    
    return (
        <>
        {
          props.comics && props.comics.map(comic =>
          <>
          <li key={comic.name}> {comic.name}</li>
          <hr />
          </>
          )
        }
        </>
    )
}

export default marvelPageItemComponent
